import { DX7VoiceCart } from 'core/models/DX7VoiceCart'
import { hex2bin } from 'core/utils/binUtils'


export function exportSysExListenerTests(onMidiMessage: (e: WebMidi.MIDIMessageEvent) => void) {
  (window as any).runSysExTestEmpty = () => {
    let cart = DX7VoiceCart.createEmpty()
    onMidiMessage({ data: cart.buildCartDX7() } as any)
  }

  (window as any).runSysExTestDX7IIVoice = () => {
    testCartParts.forEach((buf, i) => {
      setTimeout(() => {
        console.log('Sending cart part', buf.length, 'bytes')
        onMidiMessage({ data: buf } as any)
      }, i * 2000)
    })
  }
}


